import React, { useState } from 'react';
import './App.css';

function App() {
  const [text, setText] = useState('');
  const [researchTopic, setResearchTopic] = useState('');
  const [researchGoal, setResearchGoal] = useState('Exploration');
  const [timeWindow, setTimeWindow] = useState('Last Week');
  const [focusType, setFocusType] = useState('Overview');
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);

  const handleGeneratePlan = () => {
    setLoading(true);
    setResult(null);
    setTimeout(() => {
      setResult({
        plan: `Research Topic: ${researchTopic || 'N/A'}\nGoal: ${researchGoal}\nTime Window: ${timeWindow}\nFocus: ${focusType}\n\nThis is a simulated research plan based on your inputs.`
      });
      setLoading(false);
    }, 1500);
  };

  const handleClear = () => {
    setText('');
    setResearchTopic('');
    setResearchGoal('Exploration');
    setTimeWindow('Last Week');
    setFocusType('Overview');
    setResult(null);
    setLoading(false);
  };

  return (
    <div className="App">
      <h2>Research Plan Generator</h2>
      <div style={{ marginBottom: '10px' }}>
        <label>
          Research Topic:<br />
          <input
            type="text"
            value={researchTopic}
            onChange={(e) => setResearchTopic(e.target.value)}
            style={{ width: '300px' }}
            placeholder="Enter research topic"
          />
        </label>
      </div>
      <div style={{ marginBottom: '10px' }}>
        <label>
          Research Goal:<br />
          <select value={researchGoal} onChange={(e) => setResearchGoal(e.target.value)} style={{ width: '310px' }}>
            <option>Exploration</option>
            <option>Validation</option>
            <option>Optimization</option>
          </select>
        </label>
      </div>
      <div style={{ marginBottom: '10px' }}>
        <label>
          Time Limit:<br />
          <select value={timeWindow} onChange={(e) => setTimeWindow(e.target.value)} style={{ width: '310px' }}>
            <option>Last 5 years</option>
            <option>Last 3 years</option>
            <option>Last 1 year</option>
          </select>
        </label>
      </div>
      <div style={{ marginBottom: '10px' }}>
        Focus Type:<br />
        <label style={{ marginRight: '10px' }}>
          <input
            type="radio"
            value="Overview"
            checked={focusType === 'Overview'}
            onChange={(e) => setFocusType(e.target.value)}
          /> Overview
        </label>
        <label style={{ marginRight: '10px' }}>
          <input
            type="radio"
            value="Detail"
            checked={focusType === 'Detail'}
            onChange={(e) => setFocusType(e.target.value)}
          /> Detail
        </label>
        <label>
          <input
            type="radio"
            value="Summary"
            checked={focusType === 'Summary'}
            onChange={(e) => setFocusType(e.target.value)}
          /> Summary
        </label>
      </div>
      <div style={{ marginBottom: '10px' }}>
        <label>
          Additional Notes:<br />
          <textarea
            placeholder="Enter additional notes here..."
            value={text}
            onChange={(e) => setText(e.target.value)}
            rows="4"
            cols="50"
            style={{ resize: 'none' }}
          />
        </label>
      </div>
      <button onClick={handleGeneratePlan} disabled={loading} style={{ marginRight: '10px' }}>
        {loading ? 'Loading...' : 'Generate Plan'}
      </button>
      <button onClick={handleClear} disabled={loading}>
        Clear
      </button>
      {result && (
        <div style={{ marginTop: '20px', whiteSpace: 'pre-wrap', border: '1px solid #ccc', padding: '10px', borderRadius: '4px', backgroundColor: '#f9f9f9' }}>
          <h3>Generated Plan:</h3>
          <p>{result.plan}</p>
        </div>
      )}
    </div>
  );
}

export default App;
